import React from 'react';
import PortfolioItem from './PortfolioItem/Portfolioitem';
import PrevItemButton from './PrevItemButton/PrevItemButton';
import NextItemButton from './NextItemButton/NextItemButton';

const PortfolioListItems = props => {
	const styles = {
		marginLeft: '22px',
		border: '1px solid red'
	};

	console.log(props.items)

	const items = props.items.map(item => ( <
		>
		<
		PrevItemButton / >

		<
		PortfolioItem key = {
			item.id
		}
		name = {
			item.name
		}
		backgroundImageURL = {
			item.backgroundImageURL
		}
		link = {
			item.link
		}
		/>

		<
		NextItemButton / >
		<
		/>
	));

	return ( <
		div className = "portfolio-items-list"
		style = {
			styles
		} > {
			items
		} <
		/div>
	);
};

export default PortfolioListItems;
